class Server:
    """Classe que define um server e seus dados para uso do bot"""
    def __init__(self, serverID, logChannelID = None, rolepickerIDs = None):
        self.serverID = serverID
        self.logChannelID = logChannelID
        if(rolepickerIDs is None):
            self.rolepickerIDs = []
        else:
            self.rolepickerIDs = rolepickerIDs

    def setAll(self, server):
        """\"Construtor de copia\""""
        self.serverID = server.serverID
        self.logChannelID = server.logChannelID
        self.rolepickerIDs = server.rolepickerIDs

    def setServerId(self, novoID):
        """Setter do serverID"""
        self.serverID = novoID

    def getServerId(self):
        """Getter do serverID"""
        return self.serverID

    def setLogChannelID(self, novoID):
        """Setter do logChannelID"""
        self.logChannelID = novoID

    def getLogChannelID(self):
        """Getter do logChannelID"""
        return self.logChannelID

    def setRolepickerIDs(self, ids):
        """Setter do rolepickersIDs"""
        self.rolepickerIDs = ids

    def getRolepickerIDs(self):
        """Getter do rolepickersIDs"""
        return self.rolepickerIDs

    def addRolepicker(self, addID):
        """Adiciona um `rolepicker` a lista"""
        self.rolepickerIDs.append(addID)

    def removeRolepicker(self, removableID):
        """Remove um rolepicker existente"""
        if(self.isRolepicker(removableID)):
            self.rolepickerIDs.remove(removableID)

    def isRolepicker(self, verificaID):
        """Verifica se o `rolepicker` existe na lista"""
        return verificaID in self.rolepickerIDs

    def updateRolepickers(self, lista):
        """Atualiza a lista com os novos valores fornecidos na segunda lista"""
        jaTem = set(self.rolepickerIDs)
        param = set(lista)

        self.rolepickerIDs = list(jaTem | (param - jaTem))
        return self.rolepickerIDs
